Alan Shadrake (born mid-1934) is a British author and former journalist, who was arrested in Singapore in July 2010 on charges of 'criminal defamation', a day after the publication of his book, Once a Jolly Hangman: Singapore Justice in the Dock, which was critical of the Singapore judicial system.

